import React from 'react'

function Bargraph() {
    const option = {
        responsive: true,
        plugins: {
          legend: { position: "chartArea" },
          title: {
            display: true,
            text: "Modular Bar Chart",
          },
        },
      };

      const data = {
        labels:["Jan", "Feb", "Mar", "Apr", "May", "Jun"],
        datasets: [
          {
            data: [ 20, 30, 40, 50, 60,70],
            backgroundColor: "green",
          },
        ],

      };
  return (
    <div>Bargraph</div>
  )
}

export default Bargraph
